def outerProcessString(current):
    while(True):
        nextString = processString(current)
        if (len(nextString) == len(current)):
            return current
        current = nextString

def processString(a):
    for i in range(len(a) - 1):
        if (reacts(a[i], a[i+1])):
            return a[:i] + a[i+2:]
    return a

def reacts(z,y):
    return (((z.isupper() and y.islower()) or
            (z.islower() and y.isupper())) and
            z.upper() == y.upper())

